version: 1
backend:
  type: dummy
  device_id: null
signals:
  watch:
  - U_3V3
  - hs_out01_current
  - hs_out01_pwm
  - U_UB3
  plot:
  - U_3V3
  - hs_out01_current
  - hs_out01_pwm
  - U_UB3
  multi_plot:
    enabled: true
    paused: false
    windows:
    - id: 0
      axes:
        left:
        - hs_out01_current
        - hs_out01_pwm
        right: []
    - id: 1
      axes:
        left:
        - U_3V3
        - U_UB3
        right: []
channels:
  profiles:
  - name: HS1
    type: HighSide
    write:
      message: QM_High_side_output_write
      fields:
        hs_out01_select: select
        hs_out01_mode: mode
        hs_out01_value_pwm: pwm
    status:
      message: QM_High_side_output_status
      fields:
        hs_out01_current: current
        hs_out01_pwm: pwm_feedback
    sim:
      tau: 0.5
      current_gain: 8.0
      noise: 0.1
  write:
    HS1:
      message: QM_High_side_output_write
      fields:
        hs_out01_select: select
        hs_out01_mode: mode
        hs_out01_value_pwm: pwm
  status:
    HS1:
      message: QM_High_side_output_status
      fields:
        hs_out01_current: current
        hs_out01_pwm: pwm_feedback
  plot_visibility:
    HS1: false
sequencer:
  per_channel:
    HS1:
      list:
      - name: Sequence 1
        duration_s: 60
        pwm: 50
        on_s: 1.0
        off_s: 1.0
        enabled: true
      repeat_mode: 'OFF'
      repeat_limit_s: 0
startup:
  version: 1
  globals: []
  per_output:
  - channel: HS1
    message: QM_High_side_output_init_01
    fields:
      hs_out01_frequency: 2000.0
      hs_out01_pwm_min: 0.0
      hs_out01_pwm_max: 100.0
      hs_out01_Kp: 0.0
      hs_out01_Ki: 0.0
      hs_out01_Kd: 0.0
      hs_out02_frequency: 1000.0
      hs_out02_pwm_min: 0.0
      hs_out02_pwm_max: 100.0
      hs_out02_Kp: 0.0
      hs_out02_Ki: 0.0
      hs_out02_Kd: 0.0
      hs_out03_frequency: 1000.0
