      hs_out03_pwm_max: 100.0
      hs_out03_Kp: 0.0
      hs_out03_Ki: 0.0
      hs_out03_Kd: 0.0
  teardown: []
  on_connect: false
  on_apply: false
  delay_ms: 2
  only_on_change: false
state_machines:
  active: State Machine 4
  definitions:
  - name: State Machine
    states:
    - name: State 1
    - name: State 2
    - name: State 3
    transitions:
    - name: ''
      source: State 1
      target: State 1
      conditions: []
      actions: []
    - name: gydfs
      source: State 1
      target: State 1
      conditions: []
      actions: []
    initial_state: State 1
  - name: State Machine Copy
